INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (44, "トゥインクルウィッシュ", 27, 155, "東山奈央", 16, 2, "A", 100101, "獣人族", "ヒヨリ", "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", "人助け、応援", 8, 0, "人助けが大好き！　前向き格闘娘");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (47, "トゥインクルウィッシュ", 5, 158, "種田梨沙", 17, 2, "O", 100201, "ヒューマン", "ユイ", "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", "料理、人間観察", 4, 0, "戦闘のサポートが得意な、心優しい少女");
