INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (45, "トワイライトキャラバン", 5, 159, "髙野麻美", 17, 13, "A", 100901, "魔族", "アンナ", "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", "小説執筆", 7, 0, "前世を信じる中二病患者、「疾風の冥姫」");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (42, "自警団（カォン）", 22, 155, "内田真礼", 16, 10, "O", 101001, "獣人族", "マホ", "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", "空想、ぬいぐるみ集め", 9, 0, "マホマホ王国のプリンセス");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (44, "ラビリンス", 25, 156, "阿澄佳奈", 15, 3, "A", 101101, "ヒューマン", "リノ", "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", "お裁縫", 8, 0, "人懐っこくてマシンガントークな妹系少女");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (46, "フォレスティエ", 24, 156, "大橋彩香", 17, 6, "A", 101201, "エルフ", "ハツネ", "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！", "妹と遊ぶこと、二度寝、昼寝、早寝", 12, 0, "みんなのために超能力を使う眠り姫");
