INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (52, "ルーセント学院", 14, 162, "伊藤静", 23, 14, "B", 101801, "魔族", "イオ", "いつも助けてくれてありがとう\n私のほうが年上なのに\n頼ってばかりでごめんなさい～", "恋愛小説、恋愛舞台、恋愛漫画の鑑賞", 8, 0, "多くの男性を魅了する無垢な女教師");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (21, "リトルリリカル", 3, 117, "日高里菜", 10, 5, "O", 102001, "獣人族", "ミミ", "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", "かわいいもの集め", 4, 0, "お歌もにんじんも、ウサギさんも大好き♪");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (40, "サレンディア救護院", 9, 150, "植田佳奈", 12, 9, "B", 102101, "ヒューマン", "クルミ", "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "観劇、おままごと", 6, 0, "泣き虫で臆病な守ってあげたい女の子");
