INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (42, "悪魔偽王国軍（ディアボロス）", 22, 157, "大坪由佳", 18, 7, "AB", 103101, "魔族", "シノブ", "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", "占い", 12, 0, "占いが得意な霊能少女");
