INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (54, "自警団（カォン）", 9, 168, "小松未可子", 17, 10, "O", 104301, "獣人族", "マコト", "腹へってたら言えよな\n簡単でよければ\nすっげー旨いもん食わせてやるよ！", "お菓子作り", 8, 0, "男勝りで情に厚いワイルド娘");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (50, "悪魔偽王国軍（ディアボロス）", 5, 172, "丹下桜", "??", 7, "A", 104401, "魔族", "イリヤ", "test", "世界征服", 5, 0, "かつては夜を支配した最強の吸血鬼");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (49, "ヴァイスフリューゲル　ランドソル支部", 19, 157, "長妻樹里", 18, 15, "AB", 104501, "ヒューマン", "クウカ", "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", "小説を読むこと", 11, 0, "妄想大好き！　ほんとは照れ屋な女の子");
