INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (50, "王宮騎士団（NIGHTMARE）", 25, 171, "川澄綾子", 25, 8, "A", 104701, "ヒューマン", "ジュン", "？？？", "格闘技、湯浴み", 10, 0, "素顔を見せない冷静沈着な女性騎士");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (49, "メルクリウス財団", 11, 163, "田所あずさ", 20, 12, "O", 104801, "ヒューマン", "ミフユ", "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", "傭兵などのアルバイト", 11, 0, "仕事も私事も効率優先な傭兵少女");
