INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (22, "ルーセント学院", 3, 120, "久野美咲", 11, 14, "A", 105001, "魔族", "ミサキ", "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", "ファッション誌鑑賞、コスメ集め", 1, 0, "ちょっとおませな恋に恋する女の子");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (53, "トワイライトキャラバン", 7, 166, "三石琴乃", 27, 13, "A", 105101, "ヒューマン", "ミツキ", "私は科学者だけど、\n医者の真似事もしてるの\n病気になったら診てあげるわ", "研究、実験", 3, 0, "実験が趣味の危険な科学者");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (100, "牧場（エリザベスパーク）", 14, 150, "徳井青空", 18, 11, "A", 105201, "獣人族", "リマ", "私、ごく普通の、どこにでもいる女の子よ！\nみ、見た目以外はね…", "毛繕い、お喋り", 3, 0, "乙女チックなもふもふアニマル");
