INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (49, "メルクリウス財団", 11, 163, "田所あずさ", 20, 12, "O", 108001, "ヒューマン", "ミフユ（サマー）", "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", "傭兵などのアルバイト", 11, 0, "仕事も私事も効率優先な傭兵少女");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (42, "悪魔偽王国軍（ディアボロス）", 22, 157, "大坪由佳", 18, 7, "AB", 108101, "魔族", "シノブ（ハロウィン）", "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", "占い", 12, 0, "占いが得意な霊能少女");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (32, "悪魔偽王国軍（ディアボロス）", 23, 130, "雨宮天", 14, 7, "B", 108201, "魔族", "ミヤコ（ハロウィン）", "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", "プリンを食べること", 1, 0, "プリン大好きゴースト娘");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (22, "ルーセント学院", 3, 120, "久野美咲", 11, 14, "A", 108301, "魔族", "ミサキ（ハロウィン）", "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", "ファッション誌鑑賞、コスメ集め", 1, 0, "ちょっとおませな恋に恋する女の子");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (46, "カルミナ", 3, 163, "福原綾香", 17, 4, "O", 108401, "ヒューマン", "チカ（クリスマス）", "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", "各種楽器", 6, 0, "人々を守るために歌う、唱喚士の少女");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (40, "サレンディア救護院", 9, 150, "植田佳奈", 12, 9, "B", 108501, "ヒューマン", "クルミ（クリスマス）", "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "観劇、おままごと", 6, 0, "泣き虫で臆病な守ってあげたい女の子");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (38, "サレンディア救護院", 10, 148, "芹澤優", 14, 9, "B", 108601, "ヒューマン", "アヤネ（クリスマス）", "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", "屋内でできる遊び", 5, 0, "ぷうきちといつも一緒！");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (44, "トゥインクルウィッシュ", 27, 155, "東山奈央", 16, 2, "A", 108701, "獣人族", "ヒヨリ（ニューイヤー）", "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", "人助け、応援", 8, 0, "人助けが大好き！　前向き格闘娘");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (47, "トゥインクルウィッシュ", 5, 158, "種田梨沙", 17, 2, "O", 108801, "ヒューマン", "ユイ（ニューイヤー）", "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", "料理、人間観察", 4, 0, "戦闘のサポートが得意な、心優しい少女");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (46, "トゥインクルウィッシュ", 12, 163, "早見沙織", 18, 2, "B", 108901, "魔族", "レイ（ニューイヤー）", "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", "読書、乗馬、お茶", 1, 0, "クールで何事にも真っ直ぐな剣士");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (43, "トワイライトキャラバン", 30, 154, "橋本ちなみ", 16, 13, "B", 109001, "魔族", "エリコ（バレンタイン）", "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", "実験、裁縫、料理", 7, 0, "運命の相手に一途すぎる乙女");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (54, "ラビリンス", 24, 168, "生天目仁美", 18, 3, "O", 109101, "ヒューマン", "シズル（バレンタイン）", "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", "家事全般", 10, 0, "お姉ちゃんがお世話してあげるからねっ！");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (55, "？？？", 1, 156, "日笠陽子", 17, "", "AB", 109201, "ヒューマン", "アン", "私はアン！一応、マナリア王国の\n第一王女だけど…あまりかしこまらないで、\n気軽に仲良くしてくれたら嬉しいな！", "読書", 12, 0, "英霊と契約を結んだマナリアの天才王女");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (45, "？？？", 4, 144, "こやまきみこ", 15, "", "O", 109301, "ヒューマン", "ルゥ", "ルゥはルゥですぅ！マナリア魔法学院に\n通ってるですぅ。あなたもルゥの\nお友だちになってくれるですか？", "食べること、眠ること", 2, 0, "マナリア魔法学院の新入生");
INSERT INTO `v1_6d45dd9d761dfd8ac90b327e03149ced184366fda1eae00a75a7d2cf6a000092` VALUES (67, "？？？", 3, 167, "福原綾香", 17, "", "B", 109401, "半人半竜", "グレア", "私はグレア。竜と人、両方の血を\n受け継いでいるの…\nえっと…よ、よろしくね", "ピアノ", 11, 0, "人を超越した力を有す心優しい竜姫");
